import React from "react";

function  ListItem({voucher}){
   return (
       <div>
                <button  className="list-group-item list-group-item-action ">
                    <div className="d-flex w-100 justify-content-between">
                        <h5 className="mb-1">Name: {voucher.owner}</h5>
                        <small>Date: {voucher.created}</small>
                    </div>
                    <p className="mb-1">{voucher.owner} can redeem this voucher {voucher.redemptions} times</p>
                    <small>This voucher expires {voucher.expires}</small>
                </button>
       </div>


   )
}

export default ListItem
